        axios.get(`https://api.sncf.com/v1/coverage/sncf/vehicle_journeys/${idDeparture}`, {
            headers: {
                Authorization: `${process.env.REACT_APP_API_KEY}`,
            },
        }
    )
    .then((response) => {
        const stops = response.data
    })
